import React from 'react';

const watches = [
  {
    id: 1,
    name: 'Rolex Submariner',
    price: '25.000.000 TL',
    image: 'https://images.unsplash.com/photo-1524805444758-089113d48a6d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1000&q=80',
  },
  {
    id: 2,
    name: 'Omega Speedmaster',
    price: '18.000.000 TL',
    image: 'https://images.unsplash.com/photo-1542496658-e33a6d0d50a6?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1000&q=80',
  },
  {
    id: 3,
    name: 'Tag Heuer Carrera',
    price: '15.000.000 TL',
    image: 'https://images.unsplash.com/photo-1523275335684-37898b6baf30?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1000&q=80',
  },
];

const FeaturedWatches = () => {
  return (
    <div className="bg-white">
      <div className="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
        <div className="text-center">
          <h2 className="text-3xl font-extrabold tracking-tight text-gray-900 sm:text-4xl">
            Öne Çıkan Ürünler
          </h2>
          <p className="mt-4 text-xl text-gray-500">
            Dünyanın en iyi lüks saatlerini burada bulun
          </p>
        </div>

        <div className="mt-12 grid gap-8 grid-cols-1 sm:grid-cols-2 lg:grid-cols-3">
          {watches.map((watch) => (
            <div key={watch.id} className="group relative">
              <div className="w-full min-h-80 bg-gray-200 aspect-w-1 aspect-h-1 rounded-md overflow-hidden group-hover:opacity-75">
                <img
                  src={watch.image}
                  alt={watch.name}
                  className="w-full h-full object-center object-cover"
                />
              </div>
              <div className="mt-4 flex justify-between">
                <div>
                  <h3 className="text-sm text-gray-700">
                    <a href="#">
                      <span aria-hidden="true" className="absolute inset-0" />
                      {watch.name}
                    </a>
                  </h3>
                </div>
                <p className="text-sm font-medium text-gray-900">{watch.price}</p>
              </div>
              <button className="mt-4 w-full bg-indigo-600 text-white py-2 px-4 rounded-md hover:bg-indigo-700">
                Sepete Ekle
              </button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default FeaturedWatches;
